        }



        /* Iterates over all possible deletion permutations from (1) to (2^n - 1) of the input string.
         * Calls parseString() once for each permutation.
         */
        private static void mainLoop( string str ) {
            string temp = str;
            int len = str.Length;

            Console.WriteLine("Char length: " + len + "\n");
            startTime = DateTime.Now.ToString("h:mm:ss tt");
            Console.WriteLine("Start time   " + startTime + "\n\n------------------------------------------------------------------------------------------------------------------------");
            displayPercent(0);

            //Number of permutations possible
            ulong perms = (ulong)1 << len;
            
            //------Percentage complete data--------
            float percent = 0;
            float percentStep;
            if(len <= 9) {
                percentStep = 50;
            } else if(len <= 28){
                percentStep = 1;
            } else {
                percentStep = 0.5f;
            }
            ulong loopsPerStep = perms / (ulong)(100 / percentStep);
            //--------------------------------------


            /* 
             * --------------------------------------
             * Iterator loop: loops over each permutation and checks for validity
             * --------------------------------------
             */
            for(ulong index = 1; index < perms - 1; index++) {

                /* Remove current permutation's designated characters.
                 * This is done by applying the bitwise representation
                 * of 'index' as a mask on 'str' (temp is a copy of str):
                 *    0 = keep character
                 *    1 = delete character
                 */
                for(var i = len - 1; i >= 0; i--) {
                    //remove character if the 'i' bit of 'index' is 1
                    if((1 & (index >> i)) == 1) {
                        temp = temp.Remove(i, 1);
                    }
                }

                //Check permutation's validity, then reset temp
                permute(temp);
                temp = str;

                //
                if(index % loopsPerStep == 0) {
                    percent += percentStep;
                    displayPercent((int)percent);
                }
            }


            Console.WriteLine("\n----------------------------------------\n");
        }

        //Displays the percent bar while generating hits
        private static void displayPercent(int percent ) {
            Console.Write("\r" + string.Format("{0,3}", percent) + "% completed ");

            Console.Write("[[");
            for(var i = 0; i < 100; i++) {
                if(i < percent) {
                    Console.Write("-");
                } else {
                    Console.Write(" ");
                }
            }
            Console.Write("]]");
        }

        /* Checks to make sure permutations follow a set of rules, otherwise throw them out:
              - At least two words long
              - Words at least 2 characters long, or specifically allowed 1-letter or 2-letter words
              - All words must be real English
         * If a string satisfies these conditions, next check its grammar
         */
        private static void permute( string str ) {

            string[] subStrings = str.Split(null);
            int numWords = subStrings.Length;
            //Two words minimum
            if(numWords < 2) {
                return;
            }

            int realWords_count = 0;
            var partOfSpeech_list = new List<string>();



            //-----------LOOP----------
            //Check each word in the string seperately
            foreach(string cur in subStrings) {
                //Words must be at least 2 characters long, or specifically allowed 1-letter or 2-letter words
                if(cur.Length >= 3 || oneLetterWords.Contains(cur) || twoLetterWords.Contains(cur)) {
                    //Word must be real English
                    if(dictionary.TryGetValue(cur, out string partOfSpeech)) {
                        partOfSpeech_list.Add(partOfSpeech);
                        realWords_count++;
                    } else {
                        break;
                    }
                }
            }

            //All words must be real English
            if(realWords_count == numWords) {
                grammarCheck(str, partOfSpeech_list.ToArray());
            }
        }

        /* Apply grammar rules (must have subject and participle) to ensure real sentences are generated.
         */
        public static void grammarCheck( string str, string[] partOfSpeech_array ) {
            bool isSentence = false;
            bool isQuestion = false;
            int len = partOfSpeech_array.Length;

            //Check subject then participle
            int endIndex;
            endIndex = partOfSentence_analyzer(partOfSpeech_array, "n", "j", 0);
            if((endIndex > -1) && (endIndex + 1 <= len - 1)) {
                if(partOfSentence_analyzer(partOfSpeech_array, "v", "r", endIndex + 1) == len - 1) {
                    isSentence = true;
                }
            }
            //If that's false, check participle then subject
            if(!isSentence) {
                endIndex = partOfSentence_analyzer(partOfSpeech_array, "v", "r", 0);
                if((endIndex > -1) && (endIndex + 1 <= len - 1)) {
                    if(partOfSentence_analyzer(partOfSpeech_array, "n", "j", endIndex + 1) == len - 1) {
                        isQuestion = true;
                    }
                }
            }
            if(isSentence) {
                str += ".";
            } else if(isQuestion) {
                str += "?";
            } else {
                return;
            }
            string last = partOfSpeech_array[len - 1];
            if(!hasMatch(last, "a") && !hasMatch(last, "m") && (last != "u") && (last != "x") ){
                answers.Add(str);
            }
        }

        /* Checks whether a string contains a part of sentence (subject or participle).
         * Base can be "n" or "v" for noun or verb respectively.
         * Modifier can be "a" or "r" for adjective or adverb respectively
         * Returns -1 on error, otherwise returns the index of the last character in the part of speech.
         */
        private static int partOfSentence_analyzer( string[] ps, string b, string mod, int i ) {
            int ret = -1;
            int lastIndex = ps.Length - 1;
            
            //1-word pattern
            //n
            //v
            bool firstIsBase = hasMatch(ps[i], b);
            if(firstIsBase) {
                ret = i;
            }
            if((i + 1) > lastIndex) {
                return ret;
            }

            //2-word pattern
            //a n
            //r v
            bool firstIsMod = hasMatch(ps[i], mod);
            bool secIsBase = hasMatch(ps[i + 1], b);
            if(firstIsMod && secIsBase) {
                ret = i + 1;
            }
            if((i + 2) > lastIndex) {
                return ret;
            }

            //3-word pattern
            //n c n
            //v c v
            bool secIsC = hasMatch(ps[i + 1], "c");
            bool thirdIsBase = hasMatch(ps[i + 2], b);
            if(firstIsBase && secIsC && thirdIsBase) {
                ret = i + 2;
            }
            if((i + 3) > lastIndex) {
                return ret;
            }

            //4-word patterns
            //n c a n OR a n c n
            //v c r v OR r v c v
            bool thirdIsMod = hasMatch(ps[i + 2], mod);
            bool fourthIsBase = hasMatch(ps[i + 3], b);
            bool thirdIsC = hasMatch(ps[i + 2], "c");
            if(firstIsBase && secIsC && thirdIsMod && fourthIsBase) {
                ret = i + 3;
            } else if(firstIsMod && secIsBase && thirdIsC && fourthIsBase) {
                ret = i + 3;
            }
            if((i + 4) > lastIndex) {
                return ret;
            }

            //5-word pattern
            //a n c a n
            //r v c r v
            bool fourthIsMod = hasMatch(ps[i + 3], mod);
            bool fifthIsBase = hasMatch(ps[i + 4], b);
            if(firstIsMod && secIsBase && thirdIsC && fourthIsMod && fifthIsBase) {
                ret = i + 4;

            }
            //Return... finally :P
            return ret;
        }

        /* Checks if the desired string is one of the tags for the input word
         */
        public static bool hasMatch( string input, string desired ) {
            string[] words = input.Split(null);
            bool isEqual = false;
            foreach(string cur in words) {
                if(cur == desired) {
                    isEqual = true;
                }
            }
            return isEqual;
        }

        /* Checks whether each string in List<string> answer has been printed already.
         * If so, move on; otherwise, print it and record that it's been printed.
         */
        private static void printAnswers() {
            foreach(string cur in answers) {
                if(!alreadyPrinted.Contains(cur)) {
                    string toPrint = char.ToUpper(cur.First()) + cur.Substring(1).ToLower();
                    Console.WriteLine(toPrint);
                    alreadyPrinted.Add(cur);
                }
            }
        }






